import React from "react";
import "./style.css";
const Result = () => {
  return (
    <div className="grand">
      <div className="resultBox">
        <div className>
          <h2>Congratulations</h2>
          <h3>User Name</h3>
          <h2>255</h2>
        </div>

        <div className="bottom">
          <button id="restartBtn">Restart</button>
        </div>
      </div>
    </div>
  );
};
export default Result;
